//class containing binary search and linear search functions
class Search
{
  public:
  int Linear_search(int arr[], int n, int x)
  {
    int i;
    for (i = 0; i < n; i++)
        if (arr[i] == x)
            return i;
    return -1;
  }

  int Binary_search(int arr[],int l,int r, int key)
  {
       if(l<=r)
     {
         int mid = l+((r-l)/2);

         if(arr[mid]==key)
          return 1;

          else if(arr[mid]>key)
           return Binary_search(arr,l,mid-1,key);

           else
             return Binary_search(arr,mid+1,r,key);
     }

     return 0;
  }
};

